import "./App.css";
import Login from "./components/Login/Login";
import Register from "./components/Register/Register";
import Profile from "./components/Profile/Profile";
import ForgotPassword from "./components/ForgotPassword/ForgotPassword"; 
import EmailVerification from "./components/EmailVerification/EmailVerification";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useState } from "react";
import { GoogleOAuthProvider } from '@react-oauth/google';

function App() {
  const [userState, setUserState] = useState({});
  const [emailForVerification, setEmailForVerification] = useState(null);

  return (
    <div className="App">
      <GoogleOAuthProvider clientId="YOUR_GOOGLE_CLIENT_ID">
        <Router>
          <Routes>
            <Route
              path="/"
              element={
                userState && userState.id ? (
                  <Profile setUserState={setUserState} username={userState.fname} />
                ) : (
                  <Login setUserState={setUserState} />
                )
              }
            />
            <Route path="/login" element={<Login setUserState={setUserState} />} />
            <Route path="/signup" element={<Register setEmailForVerification={setEmailForVerification} />} />
            <Route path="/forgot-password" element={<ForgotPassword />} />
            <Route path="/email-verification" element={<EmailVerification emailForVerification={emailForVerification} />} />
          </Routes>
        </Router>
      </GoogleOAuthProvider>
    </div>
  );
}

export default App;
